import styles from "../../Css/nav.module.css";
import logo from "../../Images/dmlogo.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars } from "@fortawesome/free-solid-svg-icons";
import { NavLink } from "react-router-dom";

function Nav() {
  const [isLogin, setIsLogin] = useState(true);
  return (
    <div className={styles.Navbar}>
      <div className={styles.leftNav}>
        <NavLink to="/home">
          <img src={logo} alt="Dumbmerch logo" />
        </NavLink>
      </div>
      <div className={styles.rightNav}>
        <div className={styles.links} id={showLinks ? "hidden" : ""}>
          <NavLink to="/complain">Complain</NavLink>
          <NavLink to="/profile">Profile</NavLink>( isLogin === "true" ?
          <NavLink to="/category">Category</NavLink>
          <NavLink to="/product">Product</NavLink>)
          <NavLink to="/">Log out</NavLink>
        </div>

        <label htmlFor="#Bars" className={styles.Bars}>
          <FontAwesomeIcon icon={faBars}></FontAwesomeIcon>
          <button id="Bars" onClick={handleClick}></button>
        </label>
      </div>
    </div>
  );
}

export default Nav;
